                <div class="card">
                        <div class="card-body">
                            <p class="font-monospace text-uppercase">Proyecto</p>
                            <p class="font-mono">
                                Tiene como objetivo la facilitación de reportes semestrales hechos por cada carrera sobre sus estudiantes, en donde se podrán importar distintos formatos de documento (excel, cvs. etc) con datos que se verán reflejados en distintos gráficos (barras, líneas, pie) los cuales serán usados para entender de mejor manera los resultados del semestre y tener la oportunidad de anexar estas gráficas en los reportes realizados ante la universidad.
                            </p>
                            <hr class="horizontal dark">

                            <p class="font-monospace text-uppercase">Universidad</p>
                            <p class="font-mono">
                                La Universidad Internacional del Trópico Americano, Unitrópico, es la universidad pública de Casanare, que cuenta con la carrera de ingeniería de sistemas en donde se forman integralmente personas con habilidades profesionales para resolver de manera innovadora distintas problemáticas y plantear nuevos rumbos en los procesos de las organizaciones, de esta premisa se llevó a cabo la creación de proyectos como este software de estadísticas con el fin de mejorar procedimientos administrativos para la institución.
                            </p>
                            <hr class="horizontal dark">

                            <p class="font-monospace text-uppercase">Desarrollo</p>
                            <p class="font-mono">
                                El grupo de desarrollo formado por la asignatura de Práctica Técnica conformado por:
                            </p>
                            <div class="row">
                                <div class="col-md-6">
                                    <p class="font-monospace">Nicolas Leguizamo</p>
                                    <p class="font-mono">Estudiante de ingenieria de sistemas</p>
                                </div>
                                <div class="col-md-6">
                                    <p class="font-monospace">Brayan Serrano</p>
                                    <p class="font-mono">Estudiante de ingenieria de sistemas</p>
